日野車の純正運転席側サイドアンダーミラーを平面鏡に交換できます。<BR>
<FONT COLOR="＃FF0000">※熱線機能は使用できなくなります。</FONT><BR>
純正ミラーに合わせたデザイン形状です。<BR>
メッキミラーカバーも着装できます。<BR>
万一鏡が割れても破片が飛び散りにくい飛散防止処理が施してあります。 <BR><BR>

適合車種：日野プロフィア（2010.4～）/レンジャー（2011.8～）<BR>
<FONT COLOR="＃FF0000">※レンジャーは運転席側サイドアンダー着装者のみ</FONT> 
<BR><BR>
メーカー名：槌谷 ヤック株式会社<BR><BR><BR>
